css:
@-moz-document domain("ipfingerprints.com") {
html {
    background: url(https://www.ipfingerprints.com/images/light_gre.jpg) repeat scroll left top #2a2a2e!important;
    /* background-color: #f2f2f2; */
    color: #fff;
    font-family: Helvetica,Arial,san-serif;
}

#main-contents {
    background: url(https://www.ipfingerprints.com/images/bg-gradien.png) repeat-x scroll left top #2d2d31!important;
    border: 1px solid #444444;
    margin-top: 70px;
    margin-bottom: 70px;
}

#main-contents h3 p {
    color: #dedede;
}

input {
    background-color: #1d1d1d;
}

.small-last {
    color: #dedede;
}

.small-desc {
    color: #dedede;
}

.small-head {
    color: #dedede;
}


/* display none */

#header {
    display:none;
}

#main-contents h1, #footer, .right {
    display: none;
}

#main-contents > h2:nth-child(5) {
    visibility:hidden;
}

#main-contents > h2:nth-child(9) {
    display: none;
}
}
